import { Component, OnInit } from '@angular/core';
import { GetapiService } from '../services/getapi.service';

@Component({
  selector: 'app-fakeapi',
  templateUrl: './fakeapi.component.html',
  styleUrls: ['./fakeapi.component.css']
})
export class FakeapiComponent implements OnInit {
  private data:any;

   constructor(private _service:GetapiService){ }

    ngOnInit(){
      this._service.featchApis().subscribe(
        (response:any)=> {
          this.data = response;
        },
        (error:any)=> {
          console.error('URL is not valid, Please check the URL')
        }
      )
    }
   }

<table border="1" cellspacing="5px" cellpadding="5px" align="center" style="font-size:20px;">
    <thead style="background-color: aqua;">
        <tr>
            <th>PostId</th>
            <th>Id</th>
            <th>Name</th>
            <th>Email</th>
            <th>Body</th>
        </tr>
    </thead>
    <tbody>
        <tr *ngFor="let c of data">
            <td>{{ c.postId }}</td>
            <td>{{ c.id }}</td>
            <td>{{c.name}}</td>
            <td>{{ c.email}}</td>
            <td>{{ c.body}}</td>
        </tr>
    </tbody>
</table>
